import { Container } from 'react-bootstrap';
import Carousel from 'react-bootstrap/Carousel';
import Img from './Img';

function DarkVariantExample() {
  return (
    <Container>
      <h2 className="mb-5 mt-2" style={{ textAlign: "center" }}>MY PROJECT DESIGNS</h2>
      <Carousel data-bs-theme="dark">
        {Img.map((val, index) => (
          <Carousel.Item key={index}>
            <img
              className="d-block wd-500"
              src={val.url} // Use the actual image URL from your data
              alt={val.title}
            />
            <Carousel.Caption>
              <h5>{val.title}</h5>
              <p>{val.p}</p> 
            </Carousel.Caption>
          </Carousel.Item>
        ))}
      </Carousel>
    </Container>
  );
}

export default DarkVariantExample;
